import React from 'react';
import './MainContainer.css';

const numbers = [1, 2, 3, 4, 5];
const listItems = numbers.map((number) => 
  <li>{number}</li>
);

function render() {
  return (
    <ul>
      {listItems}
    </ul>
  )
}

export default render
